export const fetcher = (...args) => fetch(...args).then((res) => res.json());
export const apiKey = "7ee8fc348294f723162b9f5c8ee92c2a";
export const tmdbAPI = {
  getMovieList: (type) =>
    `https://api.themoviedb.org/3/movie/${type}?api_key=7ee8fc348294f723162b9f5c8ee92c2a`,
};
